import React, { Component } from "react";
import dynamic from "next/dynamic";

// @ts-ignore
const P5Wrapper = (sketch: any) =>
  dynamic(import("react-p5-wrapper"), {
    loading: () => <p>Loading...</p>,
    ssr: false
  });

class P5Page extends Component<{}, any> {
  static async getInitialProps(ctx: any) {
    const sketchId = ctx.query.sketchId;
    return {
      sketchId
    };
  }

  renderP5 = () => {
    const sketch = require(`../../sketches/p5/d1`).default(600, 600);
    // @ts-ignore
    return <P5Wrapper sketch={sketch} />;
  };

  render() {
    return (
      <div>
        <div className="container">{this.renderP5()}</div>
        <style jsx>{`
          .container {
            margin: 8px;
          }
        `}</style>
      </div>
    );
  }
}

export default P5Page;
